import React from "react";
import { Link } from "react-router-dom";
import './card.css'

export default function Card(props){
    return (
        <Link to='/housing' className="card">
            <img className="imgCard" src={props.cover} alt='housing'></img>
            <div className="textCard">
                <p >{props.title}</p>
            </div>

        </Link>
    )
}
